            vm.getDiffHistoricoEE = function (IdPregunta, PorcentajeActual) {
                if (IdPregunta != null && PorcentajeActual != null) {
                    try {
                        if (IdPregunta == 500) {
                            var porcentajeH = 0;
                            var idsPreg = [36, 37, 38];
                            for (var i = 0; i < 3; i++) {
                                var data = Enumerable.from(vm.listDataHistoricoEE)
                                        .select('$.Preg' + idsPreg[i]).toArray();
                                porcentajeH += data[0];
                            }
                            porcentajeH = porcentajeH / 3;
                            porcentajeH = PorcentajeActual - porcentajeH;
                            porcentajeH = Math.round(porcentajeH * 100) / 100;
                            return porcentajeH;
                        }
                        else {
                            /*Obtener porcentajeHistorico segun una pregunta*/
                            IdPregunta = vm.ordenarPreguntas(IdPregunta);
                            var data = Enumerable.from(vm.listDataHistoricoEE)
                                        .select('$.Preg' + IdPregunta).toArray();
                            if (data[0] != null) {
                                var porcentaje = PorcentajeActual - data[0];
                                porcentaje = Math.round(porcentaje * 100) / 100;
                                return porcentaje;
                            }
                            else {
                                //swal("Error, verifica el historico de la pregunta con Id: " + IdPregunta, "", "warning");
                                return 0;
                            }
                        }

                    } catch (aE) {
                        //swal(aE.message, "", "warning");
                    }
                }
            }

