            vm.getImage = function () {
                try {
                    var element = $('#fileChosse');
                    if (element[0].files.length > 0) {
                        if (!vm.validaTipoArchivo()) {
                            vm.portadaValida = false;
                            vm.ImagenPortada = "";
                        }
                        else {
                            var file = element[0].files[0];
                            var reader = new FileReader();
                            reader.onloadend = function () {
                                // console.log(reader.result)
                                $('#imagenPortada').prop('src', reader.result);
                                vm.ImagenPortada = reader.result;
                                $("#nombreArchivo").html("<i class='fas fa-check text-default' aria-hidden='true'></i> " + element[0].files[0].name);
                                $("#nombreArchivo").removeClass("invalidFile");
                                $("#nombreArchivo").addClass("validFile");
                            }
                            vm.portadaValida = true;
                            reader.readAsDataURL(file);
                        }
                    }
                    else {
                        swal("Debes elegir una imagen antes de cargarla", "", "info");
                        vm.portadaValida = false;
                        vm.ImagenPortada = "";
                        /*$('#imagenPortada').hide();*/
                    }
                } catch (aE) {
                    vm.writteLog(aE.message, "vm.getImage");
                    ////swal(aE.message, "", "warning");
                    vm.portadaValida = false;
                    vm.ImagenPortada = "";
                    $("#nombreArchivo").html("<i class='fas fa-exclamation-triangle text-default' aria-hidden='true'></i> Selecciona un archivo");
                    $("#nombreArchivo").removeClass("validFile");
                    $("#nombreArchivo").addClass("invalidFile");
                }
            }

