            vm.setClase = function (value) {
                try {
                    value = parseFloat(value);
                    if (value < 70) {
                        return "lluvia"
                    }
                    if (value >= 70 && value < 80) {
                        return "nublado";
                    }
                    if (value >= 80 && value < 90) {
                        return "solnube";
                    }
                    if (value >= 90 && value <= 100) {
                        return "sol";
                    }
                    if (value > 100) {
                        swal("Existe un porcentaje mayor a 100, verificalo", "", "warning");
                    }
                } catch (aE) {
                    ////swal(aE.message, "", "warning");
                }
            }
