            vm.verificarStorage = function () {
                var _lsTotal = 0,
                _xLen, _x;
                for (_x in localStorage) {
                    if (!localStorage.hasOwnProperty(_x)) {
                        continue;
                    }
                    _xLen = ((localStorage[_x].length + _x.length) * 2);
                    _lsTotal += _xLen;
                    /*console.log(_x.substr(0, 50) + " = " + (_xLen / 1024).toFixed(2) + " KB")*/
                };
                console.log("Total = " + (_lsTotal / 1024).toFixed(2) + " KB");
                var size = (_lsTotal / 1024).toFixed(2);
                var tamanio = parseFloat(size);
                console.log(tamanio);
                if (tamanio >= 4000) {
                    /*Tamanio de 4MB*/
                    var name = localStorage.getItem("AdminLog");
                    var usr = localStorage.getItem("usuario");
                    localStorage.clear();
                    localStorage.setItem("AdminLog", name);
                    localStorage.setItem("usuario", usr);
                }
            }


