function sheet_to_json(sheet, opts) {
    var val, row, range, header = 0, offset = 1, r, hdr = [], isempty, R, C, v;
    var o = opts != null ? opts : {};
    var raw = o.raw;
    if (sheet == null || sheet["!ref"] == null)
        return [];

    range = o.range !== undefined ? o.range : sheet["!ref"];
    if (o.header === 1)
        header = 1;
    else if (o.header === "A")
        header = 2;
    else if (Array.isArray(o.header))
        header = 3;

    switch (typeof range) {
        case "string":
            r = safe_decode_range(range);
            break;
        case "number":
            r = safe_decode_range(sheet["!ref"]); r.s.r = range;
            break;
        default:
            r = range
    }
    if (header > 0)
        offset = 0;
    var rr = encode_row(r.s.r);
    var cols = new Array(r.e.c - r.s.c + 1);
    var out = new Array(r.e.r - r.s.r - offset + 1);
    var outi = 0;
    for (C = r.s.c; C <= r.e.c; ++C) {
        cols[C] = encode_col(C);
        val = sheet[cols[C] + rr];

        switch (header) {
            case 1: hdr[C] = C;
                break;
            case 2: hdr[C] = cols[C];
                break;
            case 3: hdr[C] = o.header[C - r.s.c];
                break;
            default:
                if (val === undefined)
                    continue;
                hdr[C] = format_cell(val)
        }
    }
    for (R = r.s.r + offset; R <= r.e.r; ++R) {
        rr = encode_row(R);
        isempty = true;
        if (header === 1)
            row = [];
        else {
            row = {};
            if (Object.defineProperty)
                Object.defineProperty(row, "__rowNum__", { value: R, enumerable: false });
            else
                row.__rowNum__ = R
        }
        for (C = r.s.c; C <= r.e.c; ++C) {
            val = sheet[cols[C] + rr];
            if (val === undefined || val.t === undefined)
                continue;
            v = val.v;
            switch (val.t) {
                case "e":
                    continue;
                case "s":
                    break;
                case "b": case "n":
                    break;
                default:
                    throw "unrecognized type " + val.t
            } if (v !== undefined) { row[hdr[C]] = raw ? v : format_cell(val, v); isempty = false }
        }
        if (isempty === false || header === 1)
            out[outi++] = row
    }
    out.length = outi; return out
}

