function clientCountryEditor(container, options) {
    var objAnios = [];
    FuncionlistAnios.forEach(function (value, index, arr) {
        objAnios.push({ "AñoNameLong": value, "AñoNameShort": value });
    });
    objAnios = JSON.stringify(objAnios);

    $('<input required name="Country">')
        .appendTo(container)
        .kendoDropDownList({
            dataTextField: "AñoNameLong",
            dataValueField: "AñoNameShort",
            template: "<div class='dropdown-country-wrap'><span>#:AñoNameLong #</span></div>",
            dataSource: {
                transport: {
                    read: {
                        data: objAnios,
                    }
                }
            },
            autoWidth: true
        });
}

function BindTableHeader(jsondata, tableid) {
    tableid = "#filaHead";
    var columnSet = [];
    var headerTr$ = $('<tr/>');
    for (var i = 0; i < jsondata.length; i++) {
        var rowHash = jsondata[i];
        for (var key in rowHash) {
            if (rowHash.hasOwnProperty(key)) {
                if ($.inArray(key, columnSet) == -1) {
                    columnSet.push(key);
                    headerTr$.append($('<th/>').html(key));
                }
            }
        }
    }
    $(tableid).append(headerTr$);
    return columnSet;
}

guardarHistoricos = function () {
    var jsonData = kendo.stringify($("#grid").data("kendoGrid").dataSource.view());

    var formData = new FormData();
    var totalFiles = document.getElementById("postedFile").files.length;
    if (totalFiles > 0) {
        var file = document.getElementById("postedFile").files[0];
        formData.append("postedFile", file);
        var myarr = [];
        /*fillArrayCustom("apis/CargarHistorico/", formData, myarr, function () {
            console.table(myarr);
        });*/
        var url = urlApisjs + "apis/CargarHistorico";
        $.ajax({
            url: url,
            type: 'POST',
            data: formData,
            contentType: false,
            processData: false,
            complete: function (response) {
                if (typeof (response.responseJSON) == "string") {
                    swal(response.responseJSON, "", "info");
                }
                else {
                    response.responseJSON.forEach(function (value, index, arr) {
                        $("#listErrors").append("<li>" + value + "</li>");
                    });
                }
            },
            error: function (err) {
                /*console.clear();*/
                console.log(err);
                $("#errorMessage").text(err);
            }
        });
    }
    else {
        swal("No se ha cargado el archivo", "", "info");
    }
}